●屋根、とい、ひさし、下見板、へいなどのトタン板、カラートタン、屋外の鉄部や木部 注意　食器などの直接食器等が触れるような箇所や、常時水につかるところ、車のマフラーなど耐熱性が必要なところ、自動車・バイクの補修、床面、テーブルの天面には適しません。 ●サビの上から直接塗れる、トタン用の高光沢塗料です。●1回塗りで仕上がりますので作業性が抜群です。●特殊強化防錆剤がサビの進行を抑え、長期間素材をサビから保護します。●特殊アクリル樹脂の採用で耐候性が良好です。 ●うすめ方：塗りにくいときはペイントうすめ液（10％以内）でうすめて下さい。●乾燥時間：夏期／2～3時間　冬期／5～8時間●標準塗り面積：【1回塗り】3kg：28～35平方メートル（タタミ17～21枚分）／6kg：55～70平方メートル（タタミ33～42枚分）／12kg：110～140平方メートル（タタミ66～85枚分）<style type="text/css">
